import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './styles/root.css';
import './styles/style.css';
import './styles/form.css';
import './styles/font.css';
import Dashboard from './components/Dashboard.js';
import Sidebar from './components/Sidebar.js';
import ProjectView from './components/ProjectView.js';
import CommuteView from './components/CommuteView.js';
import EmployeeManagement from './components/EmployeeManagement.js';
import ProjectManagement from './components/projectManagement.js';
import StatisticsManagement from './components/StatisticsManagement.js';
import ActivityLog from './components/ActivityLog.js';
import LoginPage from './components/LoginPage.js';
import SigninPage from './components/SigninPage.js';


function App() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<Dashboard />} />
        <Route path='/login' element={<LoginPage />} />
        <Route path='/signin' element={<SigninPage />} />
        <div className='wrap_inner border-top--main flex'>
            <Sidebar />
        </div>
      </Routes>
    </Router>
  );
}

export default App;
